import React from 'react';

const Navbar = ({ activePage, setActivePage }) => {
  return (
    <nav className="bg-blue-600 dark:bg-gray-800 text-white shadow-md">
      <div className="container mx-auto flex justify-between items-center p-4">
        <h1 className="text-2xl font-bold">Bookstore</h1>
        <ul className="flex space-x-4">
          <li>
            <button
              onClick={() => setActivePage('addBook')}
              className={`${
                activePage === 'addBook' ? 'underline' : ''
              } hover:underline`}
            >
              Add Book
            </button>
          </li>
          <li>
            <button
              onClick={() => setActivePage('bookList')}
              className={`${
                activePage === 'bookList' ? 'underline' : ''
              } hover:underline`}
            >
              Book List
            </button>
          </li>
          <li>
            <button
              onClick={() => setActivePage('cart')}
              className={`${
                activePage === 'cart' ? 'underline' : ''
              } hover:underline`}
            >
              Cart
            </button>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
